describe("EventBus",function(){beforeEach(function(){var a;setFixtures(fixtures.html.input);a=$("#jasmine-fixtures");this.$el=a.find(".tt-input");this.eventBus=new EventBus({el:this.$el})});it("#trigger should trigger event",function(){var a=jasmine.createSpy();this.$el.on("typeahead:fiz",a);this.eventBus.trigger("fiz");expect(a).toHaveBeenCalled()});it("#before should return false if default was not prevented",function(){var a=jasmine.createSpy();this.$el.on("typeahead:beforefiz",a);expect(this.eventBus.before("fiz")).toBe(false);expect(a).toHaveBeenCalled()});it("#before should return true if default was prevented",function(){var b=jasmine.createSpy().andCallFake(a);this.$el.on("typeahead:beforefiz",b);expect(this.eventBus.before("fiz")).toBe(true);expect(b).toHaveBeenCalled();function a(c){c.preventDefault()}})});